  }

  render() {
    return (
      <div>
        <Link to={`/home`}>
          <button className="link" onMouseOver={this.handleMouseOver} onMouseLeave={this.handleMouseLeave}>
            Home
          </button>
        </Link>
        <Link to={`/about`}>
          <button className="link" onMouseOver={this.handleMouseOver} onMouseLeave={this.handleMouseLeave}>
            About
          </button>
        </Link>
        <Link to={`/portfolio`}>
          <button className="link" onMouseOver={this.handleMouseOver} onMouseLeave={this.handleMouseLeave}>
            Portfolio
          </button>
        </Link>
        <Link to={`/resume`}>
          <button className="link" onMouseOver={this.handleMouseOver} onMouseLeave={this.handleMouseLeave}>
            Resume
          </button>
        </Link>
        <Link to={`/contact`}>
          <button className="link" onMouseOver={this.handleMouseOver} onMouseLeave={this.handleMouseLeave}>
            Contact
          </button>
        </Link>
      </div>
  )
} 
}

export default Navigation;
